import React from 'react';
import { NavLink } from 'react-router-dom';
import paths from '../../config/paths'

const SignedOutLinks = () => {
    return (
        <ul className="right">
            <li><NavLink to={paths.path.sign_in} className="waves-effect waves-light">{paths.text.sign_in}</NavLink></li>
            <li><NavLink to={paths.path.sign_out} className="waves-effect waves-light">{paths.text.sign_in}</NavLink></li>
        </ul>
    )
}

export default SignedOutLinks;
